public class InnerPipelineActivityFactory(Action<Humidifier.IoTAnalytics.PipelineTypes.Activity> factoryAction = null) : SubResourceFactory<Humidifier.IoTAnalytics.PipelineTypes.Activity>
{

    internal InnerPipelineSelectAttributesFactory SelectAttributesFactory { get; set; }

    internal InnerPipelineDatastoreFactory DatastoreFactory { get; set; }

    internal InnerPipelineFilterFactory FilterFactory { get; set; }

    internal InnerPipelineAddAttributesFactory AddAttributesFactory { get; set; }

    internal InnerPipelineChannelFactory ChannelFactory { get; set; }

    internal InnerPipelineDeviceShadowEnrichFactory DeviceShadowEnrichFactory { get; set; }

    internal InnerPipelineMathFactory MathFactory { get; set; }

    internal InnerPipelineLambdaFactory LambdaFactory { get; set; }

    internal InnerPipelineDeviceRegistryEnrichFactory DeviceRegistryEnrichFactory { get; set; }

    internal InnerPipelineRemoveAttributesFactory RemoveAttributesFactory { get; set; }

    protected override Humidifier.IoTAnalytics.PipelineTypes.Activity Create()
    {
        var activityResult = CreateActivity();
        factoryAction?.Invoke(activityResult);

        return activityResult;
    }

    private Humidifier.IoTAnalytics.PipelineTypes.Activity CreateActivity()
    {
        var activityResult = new Humidifier.IoTAnalytics.PipelineTypes.Activity();

        return activityResult;
    }
    public override void CreateChildren(Humidifier.IoTAnalytics.PipelineTypes.Activity result)
    {
        base.CreateChildren(result);

        result.SelectAttributes ??= SelectAttributesFactory?.Build();
        result.Datastore ??= DatastoreFactory?.Build();
        result.Filter ??= FilterFactory?.Build();
        result.AddAttributes ??= AddAttributesFactory?.Build();
        result.Channel ??= ChannelFactory?.Build();
        result.DeviceShadowEnrich ??= DeviceShadowEnrichFactory?.Build();
        result.Math ??= MathFactory?.Build();
        result.Lambda ??= LambdaFactory?.Build();
        result.DeviceRegistryEnrich ??= DeviceRegistryEnrichFactory?.Build();
        result.RemoveAttributes ??= RemoveAttributesFactory?.Build();
    }

} // End Of Class

